            tol = 1e-6;
            x_index = 1:size(workspace,1)-1;
            isConnected = sum((abs(workspace(x_index,i) - workspace(x_index,j)) < grid.delta_q+tol)) + sum((abs(workspace(x_index,i) - workspace(x_index,j)-2*pi) < grid.delta_q+tol)) + sum((abs(workspace(x_index,i) - workspace(x_index,j)+2*pi) < grid.delta_q+tol)) == grid.n_dimensions;
        end
    end
end